(window.webpackJsonp=window.webpackJsonp||[]).push([[862],{1219:function(n,h,i){"use strict";i.r(h);var t=i(44),c=Object(t.a)({},(function(){var n=this,h=n.$createElement,i=n._self._c||h;return i("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[i("h1",{attrs:{id:"chuong-1750-hanh-đan-【-canh-4-】"}},[i("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1750-hanh-đan-【-canh-4-】"}},[n._v("#")]),n._v(" Chương 1750: Hạnh Đàn 【 Canh [4] 】")]),n._v(" "),i("hr"),n._v(" "),i("p",[n._v("Chương 1750: Hạnh Đàn "),i("br"),i("br"),n._v("“Ngươi luyện hóa xương ngực, khôi phục thực lực như thế nào?”"),i("br"),i("br"),n._v("Thấy nó hấp thu thánh tích trong đá lực lượng, tinh thần càng ngày càng tốt, Trương Huyền dò hỏi."),i("br"),i("br"),n._v("Lúc trước đối phương luyện hóa xương ngón tay, tu vi khôi phục một đoạn dài, luyện hóa đầu lâu, lần nữa tiến bộ, lần này xương ngực khổng lồ như vậy, hẳn là tiến bộ càng đại tài hơn là."),i("br"),i("br"),n._v("“Bẩm báo chủ nhân, ta đã cùng vừa mới tấn thăng Cổ Thánh tương đương, nắm giữ có thể so với Cổ Thánh sức chiến đấu!”"),i("br"),i("br"),n._v("Ngoan Nhân nói."),i("br"),i("br"),n._v("“Cổ Thánh?” Trương Huyền ánh mắt sáng lên."),i("br"),i("br"),n._v("Trước đó, liền suy đoán, cái tên này luyện hóa về sau, có thể hay không nắm giữ Cổ Thánh sức chiến đấu, hiện tại xem ra, quả là thế!"),i("br"),i("br"),n._v("Đồng dạng là Cổ Thánh, Ngoan Nhân nắm giữ trước kia kinh nghiệm chiến đấu, so với đầu kia Cổ Thánh thi thể, khẳng định cường đại không ít!"),i("br"),i("br"),n._v("Lại phối hợp thêm Yêu Dị huyền đao, tuyệt đối tương đương với có một vị chân chính Cổ Thánh, một mực thủ hộ ở chung quanh, an toàn lại không gian nan khổ cực."),i("br"),i("br"),n._v("“Ừm, hơn nữa xương ngực bị Khôi Thánh mượn Thánh tử điện trấn áp vài vạn năm, sớm đã không còn sát lục chi khí, lưu lại toàn bộ đều là tinh thuần lực lượng, hiện tại ta, thi triển ra chiêu số, giả mạo danh sư, cũng không có người nhìn ra được!”"),i("br"),i("br"),n._v("Ngoan Nhân nói tiếp."),i("br"),i("br"),n._v("“Quá tốt rồi...”"),i("br"),i("br"),n._v("Trương Huyền nắm đấm xiết chặt."),i("br"),i("br"),n._v("Mới vừa rồi còn đang nghĩ, coi như Ngoan Nhân nắm giữ Cổ Thánh lực lượng, tại danh sư đại lục, cũng không dám tuỳ tiện sử dụng, nếu không, chỉ bằng vào thông đồng Dị Linh tộc nhân, đầu này tội danh, liền hết đường chối cãi, hiện tại tốt, loại này tai hoạ ngầm, toàn bộ loại bỏ."),i("br"),i("br"),n._v("Cũng đúng, Khôi Thánh, mặc dù không phải Khổng sư đệ tử, nhưng cũng là đồ tôn của hắn, dùng tượng mượn Thánh tử điện văn khí, trấn áp xương ngực vài vạn năm, trong đó sát lục chi khí, sớm đã bị giặt sạch sẽ."),i("br"),i("br"),n._v("Xem ra sau này có thể yên tâm sử dụng Ngoan Nhân, không cần tiếp tục lo lắng, giải thích như thế nào."),i("br"),i("br"),n._v("“Ngươi trước khôi phục linh hồn, thực hiện để thực lực đạt tới cao nhất!”"),i("br"),i("br"),n._v("Biết có mạnh hơn dựa dẫm, Trương Huyền thở phào nhẹ nhõm, từ rừng đá đi ra."),i("br"),i("br"),n._v("Khổng miếu mở ra, đến đây Cổ Thánh không biết bao nhiêu, Ngoan Nhân cường đại cỡ nào chia ra, an toàn liền nhiều một phần bảo đảm."),i("br"),i("br"),n._v("Nhất định phải cẩn thận một chút."),i("br"),i("br"),n._v("Đem rất nhiều vũ khí cùng Thánh thú thu hồi, lần nữa trở lại trước đó cung điện, đem treo trên vách tường rất nhiều chân dung, cũng từng kiện từng kiện thu vào nhẫn, lúc này mới nhẹ nhàng vụt qua, đi ra ngoài."),i("br"),i("br"),n._v("Phía ngoài rất nhiều danh sư, vẫn như cũ đứng tại Thánh Tích điện bên ngoài, học tập phía trên điêu khắc công pháp và bí tịch."),i("br"),i("br"),n._v("“Viên Đào không ở nơi này, vậy ở nơi nào?”"),i("br"),i("br"),n._v("Trương Huyền nhíu nhíu mày."),i("br"),i("br"),n._v("Nơi này chỉ có Dị Linh tộc nhân, nói rõ Chư Tử bách gia người, cũng không tới, đã như vậy... Viên Đào đi nơi nào?"),i("br"),i("br"),n._v("Đang muốn lần nữa trở lại rừng đá thế giới, tiếp tục tìm kiếm, đột nhiên cổ tay khẽ đảo, một cái đưa tin ngọc bài xuất hiện tại lòng bàn tay."),i("br"),i("br"),n._v("Phía trên một nhóm chữ, hiển lộ ra."),i("br"),i("br"),n._v("“Trương Huyền, mau tới Hạnh Đàn!”"),i("br"),i("br"),n._v("“Là Lạc Nhược Hi đưa tin? Hạnh Đàn... Hạnh Đàn ở đâu? Cách thế giới, cũng có thể đưa tin?”"),i("br"),i("br"),n._v("Trương Huyền sững sờ."),i("br"),i("br"),n._v("Vừa tới đến, hắn liền thử qua, chỉ có tại cùng một cái thế giới, đưa tin ngọc phù mới có dùng, hiện tại, lại nhận được Lạc Nhược Hi tin tức..."),i("br"),i("br"),n._v("Lúc nào, có thế giới cách xa nhau, cũng có thể truyền lại tin tức? Thật muốn như vậy, trước đó, làm thế nào không đến?"),i("br"),i("br"),n._v("“Hạnh Đàn, là sa mạc thế giới đối ứng phân điện, ta tại sa mạc thế giới chờ ngươi!”"),i("br"),i("br"),n._v("Biết hắn nghi hoặc, Lạc Nhược Hi tin tức tiếp tục truyền đến."),i("br"),n._v("“Sa mạc thế giới?” Nhíu nhíu mày, Trương Huyền không có ngừng lại, lần nữa trở lại rừng đá thế giới."),i("br"),i("br"),n._v("[ truy"),i("br"),n._v("en cua tui ʘʘ vn ]  Đi qua một lần, trước đó lối vào ở nơi nào, rất dễ dàng tìm tới, thời gian không dài, liền lần nữa trở lại sa mạc thế giới."),i("br"),i("br"),n._v("Lúc này thế giới, không còn sa mạc, cũng mất cực nóng, linh khí mạnh mẽ, mặc dù không có cây cối, lại cùng trước đó rừng rậm thế giới có chút tương đương."),i("br"),i("br"),n._v("Đi vào nơi này tu luyện giả, đều tại nguyên chỗ tu luyện, từng cái rất có tinh tiến."),i("br"),i("br"),n._v("Trước đó cùng hắn có cùng xuất hiện vị kia Tâm Huyết Lai Triều cường giả, mấy canh giờ không thấy, vậy mà đã đột phá đến Bất Hủ cảnh, dung nhan tựa hồ cũng trẻ lại không ít."),i("br"),i("br"),n._v("Biết đây là Khổng miếu di tích thần kỳ, Trương Huyền cũng không nhiều lời, quyết định phương hướng, hướng trước đó ốc đảo vị trí, nhanh chóng bay lượn, thời gian không dài, quả nhiên thấy được nữ hài cùng Ngột Thần."),i("br"),i("br"),n._v("“Tới...”"),i("br"),i("br"),n._v("Lạc Nhược Hi cười cười, dường như nhìn ra hắn nghi hoặc, giải thích nói: “Khổng miếu rất nhiều thế giới, đã được đả thông, truyền lại tin tức, không có gì kỳ quái!”"),i("br"),i("br"),n._v("“Đả thông?” Sửng sốt một chút, ngay sau đó hiểu được."),i("br"),i("br"),n._v("Hắn tìm tới từng cái thế giới cửa ra vào, hơn nữa từ đó đi qua, tương đương với đem các đại thế giới nối liền cùng một chỗ, hơn nữa không chỉ hắn, hiện tại không ít danh sư, cũng tại rất nhiều thế giới xuyên qua, truyền lại tin tức cũng liền không kỳ quái."),i("br"),i("br"),n._v("“Làm sao ngươi biết, thế giới này đối ứng là Hạnh Đàn?”"),i("br"),i("br"),n._v("Rõ ràng điểm ấy, Trương Huyền vẫn như cũ có chút không hiểu."),i("br"),i("br"),n._v("Chưa đi đến vào phân điện phía trước, cũng không biết điện tên là cái gì, Lạc Nhược Hi đã biết, vì sao trước đó chưa hề nói qua?"),i("br"),i("br"),n._v("“Đã có người đi qua, biết cũng không kỳ lạ, hơn nữa, không riêng gì cái này, cái khác phân điện cũng hiểu rõ.”"),i("br"),i("br"),n._v("Lạc Nhược Hi nói: “Khổng miếu sáu đại phân điện, theo thứ tự là: Khuê Văn các, Hạnh Đàn, Lưỡng Vũ, Đại Thành điện, Tẩm điện cùng Thánh Tích điện! Chư Tử bách gia người, nắm giữ mở ra Khuê Văn các thiên phù, đã tiến vào bên trong, đem bên trong Khổng sư lưu lại tàng thư, toàn bộ dọn đi. Danh Sư đường nắm giữ Lưỡng Vũ thiên phù, Lạc gia, Trương gia cùng Dị Linh tộc, phân biệt đối ứng Tẩm điện, Đại Thành điện cùng Thánh Tích điện. Cái này mấy chỗ, đều có người tiến vào, xem như triệt để kích hoạt. Hiện tại chỉ có Hạnh Đàn không có mở ra... Cái này trận tâm, không có gì bất ngờ xảy ra, hẳn là ngươi lấy đi a! Vừa vặn cùng đi dò xét, thuận tiện đem cái này phân điện kích hoạt!”"),i("br"),i("br"),n._v("“Ngươi nói trận tâm là cái kia rễ cây?”"),i("br"),i("br"),n._v("Trương Huyền hỏi."),i("br"),i("br"),n._v("“Ừm!” Lạc Nhược Hi gật gật đầu: “Chúng ta nhanh lên một chút a, đã có không ít người đi qua, Chư Tử bách gia cũng mang đến Viên Đào, muốn mượn hắn Long Tê huyết mạch, cụ thể muốn làm gì, ta cũng không rõ lắm!”"),i("br"),i("br"),n._v("“Ừm!” Nghe được Viên Đào tại đây, Trương Huyền thở phào nhẹ nhõm."),i("br"),i("br"),n._v("“Đi qua đi!”"),i("br"),i("br"),n._v("Nói xong, Lạc Nhược Hi quay đầu nhìn về phía Ngột Thần."),i("br"),i("br"),n._v("“Ừm!” Cái này thoạt nhìn tuổi không lớn lắm đồng tử, gật gật đầu, ngón tay bỗng nhiên hướng lên trên một điểm."),i("br"),i("br"),n._v("Tê lạp!"),i("br"),i("br"),n._v("Trên ốc đảo phương không gian xuất hiện vết rách, một cái lối đi xuất hiện ở trước mắt, phía trên một tòa cung điện như ẩn như hiện."),i("br"),i("br"),n._v("“Một chỉ phá vỡ không gian?”"),i("br"),i("br"),n._v("Trương Huyền nhướng mày."),i("br"),i("br"),n._v("Sa mạc thế giới trước hắn tới qua, biết không gian trình độ chắc chắn, ít nhất cũng phải đạt tới Cổ Thánh cấp bậc mới có thể phá vỡ, Ngột Thần ngón tay một điểm liền đâm xuyên, thoạt nhìn so Yêu Dị huyền đao đều muốn ung dung... Chẳng lẽ, đã tìm tới cơ duyên, đạt đến loại cảnh giới này?"),i("br"),i("br"),n._v("“Lên đi!”"),i("br"),i("br"),n._v("Thấy hắn kỳ lạ, Lạc Nhược Hi cũng không giải thích, đi đầu bay lên trên đi, Trương Huyền theo sát trên đó."),i("br"),i("br"),n._v("Cùng mấy lần trước đồng dạng, xuyên qua không gian đi tới một chỗ đất bằng, đi không xa, quả nhiên thấy một cái thật cao kiến trúc xuất hiện ở trước mắt, hai chữ lớn lập loè ánh sáng... Hạnh Đàn!"),i("br"),i("br"),n._v("Thời khắc này cung điện phía trước, quả nhiên tới không ít người, có Chư Tử bách gia, cũng có Dị Linh tộc nhân, còn có không ít Thánh thú, tất cả đều nhìn chằm chằm, dường như chờ đợi, Khổng miếu cuối cùng này một chỗ phân điện mở ra."),i("br"),i("br"),n._v("Bốn phía mơ hồ có khí tức cường đại ẩn núp, rất hiển nhiên, mấy chỗ thế lực có thể bình an vô sự, nhất định có Cổ Thánh kiềm chế lẫn nhau ——"),i("br"),i("br"),n._v("Người đăng: ThấtDạ"),i("br"),i("br"),i("br"),i("br")]),n._v(" "),i("hr"),n._v(" "),i("p",[i("a",{attrs:{href:"./chap-1761"}},[n._v("Chương trước")]),n._v("  |  "),i("a",{attrs:{href:"./chap-1763"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=c.exports}}]);